    false,nt"url": null,nt"notes": "The overall objective of this project is
    to organize past work and conduct an 18-year assessment of the condition of the
    tree revetments placed within the Driggs River flowing through Seney National Wildlife
    Refuge. The central hypothesis is that portions of tree revetments that are more
    consistently submerged beneath the river surface will be significantly more stable
    and less decayed than the portions that are less consistently submerged beneath
